import React, {useState} from "react";

function handleChanger (){
    const [text, setText] = useState

    function onch(event) {
        const t = event.target.value
        setText(t)
    }



    return(
        <div>
            <br></br>
            <from>
                <input onChange={onch} type="text"></input>
                <button> ok </button>
            </from>

            <ul>
                <li>{text}</li>
            </ul>
        </div>
        
        
    )

}


export default handleChanger;
